import React, { Fragment } from 'react';

const Producto = ({producto}) => {
    return ( 
        <Fragment>
            <td>producto.nombre</td>
            <td>producto.precio</td>
            <td>Acciones</td>
        </Fragment>
     );
}

export default Producto;
